const Contact = () => (
  <div className="container mt-4">
    <h2>Kontakt</h2>
    <p>
      Kontakta oss på <a href="mailto:info@elsparkcyklar.se">info@elsparkcyklar.se</a> eller via formuläret här nedan.
    </p>
    {/* Här kan du lägga in ett kontaktformulär senare */}
  </div>
);

export default Contact;
